               <div className='ui form'>
                  <div className='field'>
                      <label>enter search term</label>
                      <input
                          value={term}
                          onChange={(event)=> setTerm(event.target.value)}
                          className='input'/>

                  </div>
                </div>
            </div>



    )
}


export default Search;
